import logo from './logo.svg';
import './App.css';
import Afirst from './Afirst'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Start React!
        </p>
          Learn React

      </header>
      <Afirst/>
    </div>
  );
}

export default App;
